column17:
AutoWeb's activities subject to the Fair Credit Reporting Act (FCRA) are limited to the use of background screening reports for employment-related purposes.  As part of its employment background check process, AutoWeb may collect and process the following FCRA-regulated personal information:  Identifying Information (e.g. Full name, Date of Birth, Phone Number,
Email address, Home Address, Drivers License, Passport, Social Security Number);
Credit Information (e.g. bankruptcies, liens, credit account history); Employment
Information (e.g. past and current employers, dates of employment, job titles);
Criminal Background (e.g. arrest and conviction records, pending criminal
charges, sex offender registry information); and Educational Records (e.g. degree and credential verification).

